import "./navbar.scss"
import cinema from './cinema.jpeg';

const NAVBAR = () => {
  return (
    <div className="navbar">
      <div className="container">
        <div className="left">
          
          <img src={cinema} alt="log" />
        </div>
        <div className="right"></div>
      </div>
    </div>
  )
}

export default NAVBAR
